const inaciveIcon =
    "data:image/x-icon;base64,";
const activeIcon =
    "data:image/png;base64,";

chrome.extension.sendMessage({}, function (response) {
    const readyStateCheckInterval = setInterval(function () {
        if (document.readyState === "complete") {
            clearInterval(readyStateCheckInterval);

            const isDarkTheme = window.matchMedia && window.matchMedia("(prefers-color-scheme: dark)").matches;
            // console.log(
            //     "\n\n%cWarning%c\n\n\nAn extension that customizes Toggl UI loaded.\nRemove it in case of any problems.\n\n\n",
            //     "font-family:Tahoma;font-size:20px;font-weight:bold;color:#fff;" + "background:#de0207;border-radius:5px;padding: 20px;",
            //     `background:none;color:${isDarkTheme ? "#fff" : "#000"};`
            // );

            const timerButtonInterval = setInterval(() => {
                const iconLink = document.querySelector('link[rel="shortcut icon"]');
                const button = document.querySelector('div[data-dom-element-id="timer-button"]');

                if (button) {
                    clearInterval(timerButtonInterval);

                    const observer = new MutationObserver((mutationsList, observer) => {
                        for (let mutation of mutationsList) {
                            if (mutation.type === "attributes") {
                                const title = button.getAttribute("title");
                                if (title === "Start time entry") {
                                    if (iconLink) {
                                        iconLink.setAttribute("rel", "shortcut icon");
                                        iconLink.setAttribute("href", inaciveIcon);
                                    }
                                } else if (title === "Stop time entry") {
                                    iconLink.setAttribute("rel", "shortcut  icon");
                                    iconLink.setAttribute("href", activeIcon);
                                }
                            }
                        }
                    });
                    observer.observe(button, { attributes: true });
                }
            }, 100);
        }
    }, 5);
});
